import React from "react";

function LeftSection(
  imageURL,
  productName,
  productDiscription,
  tryDemo,
  learnMore,
  googlePlay,
  appStore
) {
  return (
    <div className="container">
      <div className="row">
        <div className="col-6 p-3"></div>
        <div className="col-6 p-3"></div>
      </div>
    </div>
  );
}

export default LeftSection;
